import React from "react";
import ReactDOM from "react-dom";
import Navbar from "./NavBar";
import HomePage from "./HomePage";

function EditPage() {
    return (
        <div>
            <Navbar></Navbar>
            <center><input type="textarea" className="mt-5 textarea-style" placeholder="Enter the error content you want to share"></input></center>
        </div>
    );
}

export default EditPage;
